import React from 'react';
import logo from "../images/logo.jpeg"


function Header(){
  var heading = "DESK SKILL";
  return(
    <div id="header">
      <div id="logo-div">
      <img src={logo} alt='error'/>
      </div>
      <div>
      <h1 style={{textAlign: "center"}}>{heading}</h1>
      </div>
    </div>
  )
}

export default Header
